import React from "react";
import { Segment, Header, Input } from "semantic-ui-react";

const OrderReceived = () => (
  <Segment>
    <Header>Review McDonalds</Header>
    <Input style={{height: 200}} fluid placeholder="Positive/negative comments about the food..." />
  </Segment>
);

export default OrderReceived;
